import axios from "axios";

class Nurseaxios{

//Get nurse Data

getnurse(token){
let response=axios.get(`http://localhost:9082/api/nurseDetails/`,{
    headers:{
        'AUTHORIZATION': `Bearer ${token}`
    }
});
return response;
}

deletenurse(nid){
    let response=axios.delete(`http://localhost:9082/api/nurseDetails/${nid}`)
    return response;
}
}

export default Nurseaxios;
